import React from 'react';
import './Unit.css';

function Unit({ unit }){
    const topics = [
        ['Types of Variables', 'Converting Categorical Data into Numeric Data']
        ['K-Means', 'Principal Component Analysis (PCA)']
    ]
    return (
        <h2>Unit {unit}</h2>
    );
};
export default Unit;
